// ** User List Component
import TableWithDraw from "./withdraw/index";
import TableDeposit from "./deposit/Table";
import TableSales from "./sales/Table";
import TableSwap from "./swap/Table";
import TableCashFlow from "./cashFlow/Table";
// ** React Imports
import { useState, useEffect } from "react";
import { useParams, Link } from "react-router-dom";

import { useSelector, useDispatch } from "react-redux";

// ** Third Party Components
import { User, Info, Share2 } from "react-feather";
import {
  Card,
  CardBody,
  CardHeader,
  Car,
  Row,
  Col,
  Nav,
  NavItem,
  NavLink,
  TabContent,
  TabPane,
  Alert,
} from "reactstrap";
// ** Styles
import "@Styles/react/apps/app-users.scss";

const UsersList = () => {
  const [activeTab, setActiveTab] = useState("1");
  return (
    <div className="app-user-list">
      <CardHeader>
        <Nav pills>
          <NavItem>
            <NavLink
              active={activeTab === "1"}
              onClick={() => setActiveTab("1")}
            >
              <User size={14} />
              <span className="align-middle d-none d-sm-block">Withdraw</span>
            </NavLink>
          </NavItem>
          <NavItem>
            <NavLink
              active={activeTab === "2"}
              onClick={() => setActiveTab("2")}
            >
              <Info size={14} />
              <span className="align-middle d-none d-sm-block">Deposit</span>
            </NavLink>
          </NavItem>
          <NavItem>
            <NavLink
              active={activeTab === "3"}
              onClick={() => setActiveTab("3")}
            >
              <Share2 size={14} />
              <span className="align-middle d-none d-sm-block">
                Lịch sử mua/bán
              </span>
            </NavLink>
          </NavItem>
          <NavItem>
            <NavLink
              active={activeTab === "4"}
              onClick={() => setActiveTab("4")}
            >
              <Share2 size={14} />
              <span className="align-middle d-none d-sm-block">Swap</span>
            </NavLink>
          </NavItem>
          <NavItem>
            <NavLink
              active={activeTab === "5"}
              onClick={() => setActiveTab("5")}
            >
              <Share2 size={14} />
              <span className="align-middle d-none d-sm-block">Cash Flow</span>
            </NavLink>
          </NavItem>
        </Nav>
      </CardHeader>
      <CardBody className="pt-2">
        <TabContent activeTab={activeTab} key={activeTab}>
          <TabPane tabId="1">{activeTab == "1" && <TableWithDraw />}</TabPane>
          <TabPane tabId="2">{activeTab == "2" && <TableDeposit />}</TabPane>
          <TabPane tabId="3">{activeTab == "3" && <TableSales />}</TabPane>
          <TabPane tabId="4">{activeTab == "4" && <TableSwap />}</TabPane>
          <TabPane tabId="5">{activeTab == "5" && <TableCashFlow />}</TabPane>
        </TabContent>
      </CardBody>
    </div>
  );
};

export default UsersList;
